public boolean equals(Object obj) {
  if (obj == this) {
    return true;
  } else if (obj == null || !(obj instanceof EnumCounters)) {
    return false;
  }
  final EnumCounters<?> that = (EnumCounters<?>)obj;
  return this.enumClass == that.enumClass
      && Arrays.equals(this.counters, that.counters);
}
